  const defaultState = {
    isLoggedIn: false,
    username: null,
    displayName: null,
    image: null,
    password: null
  }

  const authReducer = (state,action) => {
    if (action.type === "logout-success"){
      return defaultState;
    }
    return state;
  }

  export default authReducer;
